import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

import landingpage from "./landingpage";
import contact from "./contact";

const Main = () => (
  <BrowserRouter>
    <Switch>
      <Route exact path="/" component={contact} />
    </Switch>
  </BrowserRouter>
);

export default Main;
